import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './index.css';

class initialProfile extends Component {
	constructor(props) {
		super(props);
		this.state = {
			gender: '',
			secualPreference: '',
			biography: '',
		}
	}

	componentDidMount() {
		console.log(this.state.gender)
	}

	render() {
		return (
			<div>
				<div className="header">
					<div id="title">MATCH<span className="red">A</span></div>
					<div><Link to="/" className="loginheader">Logout</Link></div>
				</div>
				<div className="rest">
					<div>Tell Us More about Yourself</div>
					<form className="toggle">
							<input
								type="radio"
								value="female"
								id="female"
								name="gender"
								onChange={e => this.setState({ gender: e.target.value })}
								checked
								/>
							<label htmlFor="female">Female</label>
							<input
								type="radio"
								value="male"
								id="male"
								onChange={e => this.setState({ gender: e.target.value })}
								name="gender"
							/>
							<label htmlFor="male">Male</label>
					</form>
				</div>
			</div>
		)
	}
}

export default initialProfile;
